import React from 'react';


function calc(){
    return(
        <>
        <ul>
            <li>
             The sum of two no. is{add(30, 4)}
            </li>
            <li>
             The sub of two no. is{sub(20,4)}
            </li>
            <li>
             The mult of two no. is{mult(4,8)}
            </li>
            <li>
             The div of two no. is {div(7,21)}
            </li>
        </ul>
        </>
    
    )
}

function add(a,b){
    let sum = a+b;
return(sum);
}
function sub(a,b){
    let sub = a-b;
return(sub);
}
function mult(a,b){
    let mul = a*b;
return(mul);
}
function div(a,b){
    let div = a/b;
    div = div.toFixed(2);
return(div);
}

export {add,sub, mult,div};
